    tmp: [],

    lzma:null,
    //extraTexture: [],
    dracoLoader: null,
    //dracoLoaderType:'js',
    dracoPath:'./src/libs/draco/',
    basisPath:'./src/jsm/libs/basis/',

    formatGltf : {
        draco:true,
        ktx2: false,
        meshop: false,
    },

